import "./App.css";
import Login from "./pages/Login";
import Cadastro from "./pages/Cadastro";

function App() {
  return (
    <div className="App">
      <h1 className="login">Login</h1>
      <Login />
      <h2 className="login">Cadastro</h2>
      <Cadastro />
    </div>
  );
}

export default App;
